import React, { useEffect, useState, } from 'react';
import axios from 'axios';

function AllUsers(){



    const url = "https://01vablvh7h.execute-api.us-east-1.amazonaws.com/dev/getallregistereduser"
    const [product, setProduct] = useState(null);

    let content = null;
    useEffect(() => {
        axios.get(url)
            .then(response => {
                setProduct(response.data)
        })
    } , [url])



    if(product){
        return (
            <div>
                <table className ="table">
                <thead className="thead-dark">
                    <tr>
                        <th scope="col">First Name</th>
                        <th scope="col">Last Name</th>
                        <th scope="col">Email</th>
                        <th scope="col">Role</th>
                        <th scope="col">Status</th>
                        <th scope="col">Actions</th>
                    </tr>
                </thead>

                {product.body.map(({firstName, lastName, email, role}) => (
                    <li key={firstName}>
                        First Name: {firstName}, lastName: {lastName}, Email: {email}, Role: {role}
                    </li>))
                })
                {console.log(product.body.length)}




                </table>



            </div>
        )
    }

    return (

        <div>
            {content}
        </div>
    )


}

export default AllUsers;
